window.bookSummaryJSON = "<p><b>The World has a new Witch. The Federation Navy wants her. </b></p> <p>But she has to decide if she wants the Federation Navy. </p> <p>Stephanie Morgana comes from a long line of Morganas, much longer than she ever realized. </p> <p>The Artificial Intelligence which runs the Virtual World has decided that it needs to break a few rules in order to follow its prime directives. </p> <p>Can it help Stephanie acquire her skills quickly enough to help defend against an evil already heading toward the Federation? </p> <p><b>Will Stephanie overcome her injuries from the battle for the Ambassador, or will she succumb to the pain it brought about? Will BURT be able to help the Federation while remaining</b> <b><i>undiscovered</i></b><b>?</b> </p>"; 
